void WriteOutTestCzi(const char* testcaseName, const char* testname, const void* ptr, size_t size)
{
    if (WRITEOUT_CZI)
    {
        std::string s("L:\\temp\\X\\");
        s += testcaseName;
        s += '_';
        s += testname;
        s += ".czi";
        FILE* fp = fopen(s.c_str(), "wb");
        if (fp)
        {
            fwrite(ptr, size, 1, fp);
            fclose(fp);
        }
    }
}

